import './css/nav.css';

function Nav(){
    return(
        <>
            <nav className="back-nav">
                <ul className="ul-nav">
                    <li className="li-nav">To Do</li>
                    <li className="li-nav">Doing</li>
                    <li className="li-nav">Done</li>
                </ul>
            </nav>
        </>
    );
}

export default Nav;
